import{_ as e,o as r,c as o,O as t}from"./chunks/framework.9482e208.js";const g=JSON.parse('{"title":"§ 19.2-335 Judge of district court to certify to clerk of circuit court costs of proceedings in criminal cases before him.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/19.2-335.md","filePath":"vacode/19.2-335.md"}'),c={name:"vacode/19.2-335.md"},i=t('<h1 id="§-19-2-335-judge-of-district-court-to-certify-to-clerk-of-circuit-court-costs-of-proceedings-in-criminal-cases-before-him" tabindex="-1">§ 19.2-335 Judge of district court to certify to clerk of circuit court costs of proceedings in criminal cases before him. <a class="header-anchor" href="#§-19-2-335-judge-of-district-court-to-certify-to-clerk-of-circuit-court-costs-of-proceedings-in-criminal-cases-before-him" aria-label="Permalink to &quot;§ 19.2-335 Judge of district court to certify to clerk of circuit court costs of proceedings in criminal cases before him.&quot;">​</a></h1><p>A judge of a district court before whom there is any proceeding in a criminal case, including any proceeding that has been deferred upon probation of the defendant pursuant to § <a href="/vacode/16.1-278.8/">16.1-278.8</a>, <a href="/vacode/16.1-278.9/">16.1-278.9</a>, <a href="/vacode/18.2-61/">18.2-61</a>, <a href="/vacode/18.2-67.1/">18.2-67.1</a>, <a href="/vacode/18.2-67.2/">18.2-67.2</a>, <a href="/vacode/18.2-251/">18.2-251</a>, <a href="/vacode/19.2-298.02/">19.2-298.02</a>, <a href="/vacode/19.2-303.2/">19.2-303.2</a>, or <a href="/vacode/19.2-303.6/">19.2-303.6</a>, shall certify to the clerk of the circuit court of his county or city, and a judge or court before whom there is, in a criminal case, any proceeding preliminary to conviction in another court, upon receiving information of the conviction from the clerk of the court wherein it is, shall certify to such clerk, all the expenses incident to such proceedings which are payable out of the state treasury.</p><p>Code 1950, § 19.1-319; 1960, c. 366; 1968, c. 639; 1975, c. 495; 1995, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?951+ful+CHAP0485" target="_blank" rel="noreferrer">485</a>; 2005, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?051+ful+CHAP0631" target="_blank" rel="noreferrer">631</a>; 2020, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?201+ful+CHAP1004" target="_blank" rel="noreferrer">1004</a>; 2020, Sp. Sess. I, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?202+ful+CHAP0021" target="_blank" rel="noreferrer">21</a>.</p>',3),a=[i];function n(s,f,d,l,h,u){return r(),o("div",null,a)}const _=e(c,[["render",n]]);export{g as __pageData,_ as default};
